var $bm_rt;
var slider, numDecimals, commas, dollarSign, percentSign, s, prefix, suffix, prefix, s, prefix, suffix, decimals, decimals, s, outStr, i, outStr;
slider = effect('Slider Control')('Slider');
numDecimals = 0;
commas = false;
dollarSign = false;
percentSign = true;
s = slider.value.toFixed(numDecimals);
prefix = '';
$bm_rt = suffix = '';
if (s[0] == '-') {
    prefix = '-';
    $bm_rt = s = s.substr(1);
}
if (dollarSign)
    $bm_rt = prefix = $bm_sum(prefix, '$');
if (percentSign)
    $bm_rt = suffix = '%';
if (commas) {
    decimals = '';
    if (numDecimals > 0) {
        decimals = s.substr($bm_neg($bm_sum(numDecimals, 1)));
        s = s.substr(0, $bm_sub(s.length, $bm_sum(numDecimals, 1)));
    }
    outStr = s.substr($bm_neg(s.length), $bm_sum($bm_mod($bm_sub(s.length, 1), 3), 1));
    for (i = Math.floor((s.length - 1) / 3); i > 0; i--) {
        outStr = $bm_sum(outStr, $bm_sum(',', s.substr($bm_mul($bm_neg(i), 3), 3)));
    }
    $bm_rt = $bm_sum($bm_sum($bm_sum(prefix, outStr), decimals), suffix);
} else {
    $bm_rt = $bm_sum($bm_sum(prefix, s), suffix);
}

